import React from 'react';

import './Table.scss';
import { Modal } from 'react-bootstrap';
import Pagination from 'react-js-pagination';
import CustomPagination from '../CustomPagination/CustomPagination';
export default props => {
  const {heade, body, handlePageChange} = props;
  return (
    <div>
      <div className="custom-table border table-responsive ">
        <table className="table ">
          <thead>
            {heade}
          </thead>
          <tbody>
            {body}
          </tbody>
        </table>
      </div>
     <CustomPagination 
      start={1}
      end={5}
      pages={10}
      currentPage={2}
     />
    </div>
  );
};
